SELECT name, MAX (signed_in_at) FROM programmers 
WHERE name LIKE 'R%' ;
GROUP BY name

SELECT name, max(signed_in_at) FROM programmers 
WHERE (name LIKE 'R%')
GROUP BY name;

SELECT name, signed_in_at FROM programmers 
WHERE (signed_in_at = max(signed_in_at)) AND (name LIKE 'R%')
GROUP BY name;

SELECT name, signed_in_at FROM programmers
WHERE name LIKE 'R%'
LIMIT 1 ORDER BY signed_in_at;

